function symbol() public view returns (string memory) {
    if (symbolStorage != 0) {
        uint256 symbolLength = uint256(uint8(symbolStorage >> 248));
        if (symbolLength > 0 && symbolLength <= 32) {
            bytes32 symbolData = symbolStorage & 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF;
            return string(abi.encodePacked(symbolData));
        } else if (symbolLength > 32) {
            uint256 offset = uint256(uint8(symbolStorage >> 248));
            bytes memory symbolBytes = new bytes(symbolLength);
            for (uint256 i = 0; i < symbolLength; i++) {
                symbolBytes[i] = byte(uint8(symbolStorage[offset + i]));
            }
            return string(symbolBytes);
        }
    }
    return "";
}

